import './home.scss';
// import Projects from '../Projects/projects';
const axios = require('axios')
import About from '../About/about';

const sheetsDB = "https://spreadsheets.google.com/feeds/cells/1EiFmoErOHeRcE0dUUXdwk_wf1mfcgq4d-25uShy-47A/od6/public/basic?alt=json";



function Home() {


  return (
    <div className="Home">
      <div className="Intro">
        <div className="Name">Bryan Min</div>
        <div className="Greeting">
          <h6>I’m a student at UC Santa Cruz studying Computer Engineering who also loves aesthetic design. Currently, I’m making cool things as a Web Developer in the <a href="https://tech4good.soe.ucsc.edu/#/" target="_blank" rel="noreferrer"><b>Tech4Good Labs</b></a>.</h6>
        </div>
      </div>

      <About />
    </div>
  )
}

export default Home
